import jsPDF from "jspdf";

const regularFont = '';

const GeneratePricePDF = (classes) => {
	const pdf = new jsPDF();

	// Add fonts to a virtual file system (vFS)
	pdf.addFileToVFS("Finlandica.ttf", regularFont);
	pdf.addFont("Finlandica.ttf", "Regular", "normal");

	// Page dimensions and coordinates
	const pageWidth = pdf.internal.pageSize.getWidth();
	const centerX = pageWidth / 2;
	let yOffset = 20; // Start indent for header

	// *** HEADER ***
	// Add the header
	pdf.setFont("Regular", "normal");
	pdf.setFontSize(36);
	pdf.text("EMPTYWALL", centerX, yOffset, { align: "center" });
	yOffset += 15;

	// *** TABLE ***
	// Getting the table from the page
	const element = document.getElementById("price_data");
	const table = element.querySelector("table");
	const rows = table.querySelectorAll("tr");

	// Style for the table
	pdf.setFontSize(12);
	const tableWidth = pageWidth - 40;
	const lineHeight = 5;

	// Iterate over the rows of the table
	rows.forEach((row, rowIndex) => {

		if (rowIndex > 0) {
			yOffset += lineHeight + 2;
		}

		const th = row.querySelector("th");
		
		if (th) {
			// Handling TH
			const headerText = th.innerText;

			const thWidth = pageWidth - 40;

			pdf.setFillColor(196, 196, 196);
			pdf.rect(20, yOffset - lineHeight, thWidth, lineHeight * 1.4, "DF");
			
			pdf.setFontSize(12);
			pdf.text(headerText, centerX, yOffset, { align: "center" });
		} else {
			// Handling TD
			const td = row.querySelectorAll("td");

			if (td.length === 2) {
				// If the row contains 2 columns
				pdf.setFillColor(242, 242, 242);
				pdf.rect(20, yOffset - lineHeight, tableWidth * 0.8, lineHeight * 1.4, "DF");
				pdf.text(`  ${td[0].innerText}`, 20, yOffset); // First column

				pdf.setFillColor(242, 242, 242);
				const secondColX = 20 + tableWidth * 0.8 + (tableWidth * 0.2) / 2; // Centre of the second column
				pdf.rect(20 + tableWidth * 0.8, yOffset - lineHeight, tableWidth * 0.2, lineHeight * 1.4, "DF");
				pdf.text(td[1].innerText, secondColX, yOffset, { align: "center" });

			} else if (td.length === 1) {
				// If the row contains 1 column
				pdf.setFillColor(242, 242, 242);
				pdf.rect(20, yOffset - lineHeight, tableWidth, lineHeight * 1.4, "DF");
				pdf.text(`  ${td[0].innerText}`, 20, yOffset);
			}
		}
	});

	// *** FOOTER ***
	const priceNotes = element.lastChild;
	const leftMargin = 25;
	const bulletMargin = 5;
	yOffset += 12;

	const note = priceNotes.querySelector("span").innerText;
	pdf.setFontSize(12);
	pdf.setCharSpace(-0.1);
	pdf.text(note, leftMargin, yOffset, { maxWidth: pageWidth - 40 });
	yOffset += 12;

	const additionalServicesHeader = priceNotes.querySelector("h3").innerText;
	pdf.setFontSize(18);
	pdf.text(additionalServicesHeader, leftMargin, yOffset, { maxWidth: pageWidth - 40 });
	yOffset += 12;

	const additionalList = priceNotes.querySelector("ul");
	const items = additionalList.querySelectorAll("li");
	pdf.setFontSize(12);

	items.forEach((item) => {
		const text = item.innerText;
		const formattedText = pdf.splitTextToSize(text, pageWidth - leftMargin - 25); // Учитываем отступ

		// Output the '•' first, then the text.
		pdf.text("•", leftMargin, yOffset);
		pdf.text(formattedText, leftMargin + bulletMargin, yOffset);

		// Offset down by the number of rows
		yOffset += formattedText.length * 5;
	});

	// Save PDF
	pdf.save("price-list.pdf");
};

export default GeneratePricePDF;